import React from 'react';
import styled from 'styled-components';

interface Props {}
const Container = styled.div`
  min-height: 100vh;
  width: 100%;
  max-width: 800px;
  padding-top: 75px;
  box-sizing: border-box;
`;
const Home: React.FC<Props> = () => {
  return (
    <Container>
      <div>Welcome</div>
      <div>chat-bot</div>
    </Container>
  );
};

export default Home;
